import React from 'react';

function AdditionalOptions() {
  const features = {
    "Maps" : "leaflet",
    "Audio Manipulation" : "",
    "Video Manipulation" : "",
    "Online Store" : "",
    "Payments" : "PayPal",
    "Blog" : "",
    "Internationalization" : "",
    "ERP" : ""
  };

  let featureList = [];

  for (i of features) {
    featureList.push(<li key={i}>{features[i]}</li>)
  };

  return (
    <div className="row">
      <h2>Additional Options</h2>
      <p>The sky is the limit.  Open-source technology provides all kinds of solutions that can be integrated into projects and modified as needed without any liscencing fees.  You business may require custom functionality for any number of purposes.  These are just a few of the features that could be included in your project:</p>
      <ul>
        {featureList}
      </ul>
    </div>
  );
}

export default AdditionalOptions;
